import React, { Component } from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';
// import Public from './components/Public';
// import Protected from './components/Protected';
import SignUpPage from "./singUpPage";

import Auth from './../auth/Auth';
import MapUser from "./MapUser";
import AccountSettingPage from "./AccountSetting";


// const ProtectedRouter = (props) => (
//     // <Switch>
//         <PrivateRoute  component={MapUser} />
//     // </Switch>
// )
export default function ProtectedRouter(props) {
    return (
        <>
        <Switch>

         <PrivateRoute path="home-page"  component={MapUser} />
         </Switch>

         {/* <PrivateRoute path="settings"  component={AccountSettingPage} /> */}
         {/* <PrivateRoute path="test"  component={SignUpPage} /> */}

        </>
        ) 
}
///#/protected

const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route
    {...rest}

        render={props =>
            Auth.getAuth() ? (
                <Component {...props} />
            ) : (
                <Redirect to={{ pathname: "/"}}/>
            )
        }
    />
);
// export default ProtectedRouter;
